import React from "react";

const Admincard = ({ logo, name }) => {
  return (
    <div className="admin-card">
      <div className="logo">
        <img src={logo} className="img-fluid" alt={name} />
      </div>
      <div className="name">{name}</div>
    </div>
  );
};

export default Admincard;
